import React, { useEffect, useState } from 'react';

const TableData = () => {
    const [show, setShow] = useState(false);
    const [users, setUser] = useState([{}]);
    useEffect(() => {

        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')
                setUser(data);
                setShow(true);
            })
    }, []);

    return (

        <>
           
            <h1>
                {show && <h1>

                    {
                        Object.keys(users).map((key, i) => (
                            
                                <select >
                                <option >{key}</option>
                                {
                                    Object.keys(key).map((keys,i)=>(
                                        <option >{users[key][i]}</option>
                                    ))           
                                }
                                </select>
                        ))



                        <div><d/>
                    }
                </h1>
                }

            </h1>
        </>
    );
};

export default TableData;
